Nowa wersja kultowego utworu z lat 90’.
Posłuchaj na Spotify: 👇
https://open.spotify.com/track/5cfppRJlHwshtO6lC8xVb6?si=9IL68sllTaGAjzjdfGTa4w

Oryginał „It’s My Life” stał się przebojem w większości krajów europejskich, w których został wydany.
Zapraszamy do odsłuchu nowej wersji wzbogaconej o gościnną zwrotkę Popka.
Produkcją singla zajął się Claysteer. 



